<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":156,"name":"Shift","language":"python","commands":[{"version":"CommandV1","origId":158,"guid":"d1144a57-0583-4227-b253-13c3abfd710b","subtype":"command","commandType":"auto","position":0.25,"command":"%md # Shift Expected Margin\n### Exploratory Data Analysis and Predictive Models\nby: Huang Pan\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282333662E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"14238e90-08b9-4937-96ca-8a0f0d8fa1a3"},{"version":"CommandV1","origId":159,"guid":"fb98555e-6ca8-4907-9e91-d2fbe141087e","subtype":"command","commandType":"auto","position":0.265625,"command":"%md ### Notebook Outline\n\n1. Introduction<br>\n  a. ETL<br>\n  b. Plan of Action<br>\n2. Exploratory Data Analysis with Percent to Market Model<br>\n3. Predictive Models<br>\n  a. Currently Available Research<br>\n   b. Feature Exploration<br>\n   c. Linear Regression<br>\n   d. Gradient Boosted Tree Regression<br>\n5. Further Research<br>","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282333695E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"a71731a6-deb4-4df8-8943-6e6ddbc376a8"},{"version":"CommandV1","origId":160,"guid":"cf6f1c6a-d9dd-4e97-ba50-cba470e9b7ba","subtype":"command","commandType":"auto","position":0.3125,"command":"%md ### Overview\n\nShift’s operations team that is responsible for customer outreach deals with thousands of potential sellers per month. One way our data scientists can make their job easier is by prioritizing which sellers they outreach to first. The goal of this assignment is to derive a score that represents the expected value to Shift of acquiring a specific vehicle. The expected value that we want to derive in this homework assignment is the difference between what Shift can sell the vehicle for at retail and what dealerships buy vehicles for at wholesale.\n\n### The Data\n\nThe dataset includes a random sample of seller inquiries Shift has received in the last ~5 months for a select set of models. You will find that some sellers have expected value set to $0, and that’s because they never ended up selling their vehicle through Shift, so we don’t know what we could have sold their car for at retail. The other set of sellers, those that have a non-zero value for expected margin, did sell their vehicle through Shift and the value represents the final selling price less the wholesale value of their vehicle.\n\nQ: What is the wholesale value? <br>\nA: The wholesale value is how much this vehicle would have sold for at an auction.\n\n### The Assignment\n\nWe’d like you to present to our engineering and data science team your approach to the problem, which statistical/machine learning methods you used to come up with the model, the model itself and accuracy of your predictions. A handful of slides will suffice, but in addition to the presentation, we would like to see your code 0,5975.0,"shift.com",2375.0]],"arguments":{},"addedWidgets":{},"removedWidgets":[],"schema":[{"name":"quote_id","type":"\"string\"","metadata":"{}"},{"name":"year","type":"\"integer\"","metadata":"{}"},{"name":"make","type":"\"string\"","metadata":"{}"},{"name":"model","type":"\"string\"","metadata":"{}"},{"name":"mileage","type":"\"integer\"","metadata":"{}"},{"name":"location_zip","type":"\"integer\"","metadata":"{}"},{"name":"percent_to_market","type":"\"double\"","metadata":"{}"},{"name":"market_avg_days_to_sell","type":"\"integer\"","metadata":"{}"},{"name":"n_similar_vehicles_listed","type":"\"integer\"","metadata":"{}"},{"name":"region_short_code","type":"\"string\"","metadata":"{}"},{"name":"exact_list_price","type":"\"integer\"","metadata":"{}"},{"name":"wholesale_price","type":"\"integer\"","metadata":"{}"},{"name":"seller_source","type":"\"string\"","metadata":"{}"},{"name":"expected_margin","type":"\"integer\"","metadata":"{}"}],"overflow":false,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.478282365612E12,"submitTime":1.478282335595E12,"finishTime":1.478282367381E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"fcd60466-187d-4a32-9cb9-d42ed2648770"},{"version":"CommandV1","origId":164,"guid":"e61b4b92-7ee6-486f-9ace-422bcd900fac","subtype":"command","commandType":"auto","position":0.66796875,"command":"%sql\n\n-- Data Cleaning\nDROP TABLE IF EXISTS clean_data1;\nDROP TABLE IF EXISTS clean_data2;\nDROP TABLE IF EXISTS clean_data3;\nDROP TABLE IF EXISTS clean_data4;\nDROP TABLE IF EXISTS clean_data5;\nDROP TABLE IF EXISTS clean_data6;\nDROP TABLE IF EXISTS clean_data7;\n\n-- Remove rows with any missing data (nulls)\nCREATE TABLE clean_data1 AS\nSELECT * FROM training_data\nWHERE year IS NOT NULL AND make IS NOT NULL AND model IS NOT NULL AND mileage IS NOT NULL AND location_zip IS NOT NULL AND percent_to_market IS NOT NULL AND market_avg_days_to_sell IS NOT NULL AND n_similar_vehicles_listed IS NOT NULL AND region_short_code IS NOT NULL AND seller_source IS NOT NULL;\n\n-- Remove rows with null or 0 wholesale price / exact_list_price; expected margin just don't look right for that those rows\nCREATE TABLE clean_data2 AS\nSELECT * FROM clean_data1\nWHERE wholesale_price IS NOT NULL AND wholesale_price != 0 AND exact_list_price IS NOT NULL AND exact_list_price != 0;\n\n-- Remove outliers in expected_margin column\nCREATE TABLE clean_data3 AS\nSELECT * FROM clean_data2\nWHERE expected_margin BETWEEN -50000 AND 100000;\n\n-- Remove outliers in percent_to_market column\nCREATE TABLE clean_data4 AS\nSELECT * FROM clean_data3\nWHERE percent_to_market BETWEEN .8 AND 1;\n\n-- Remove outliers in market_avg_days_to_sell column; zeros were screwing up the log transforms, one outlier >> 500\n-- Looking at the data, the zeros are clearly erroneous - similar make/model/year have different non-zero values\n-- In reality, those zeros need to be cleaned up and replaced by something more realistic\nCREATE TABLE clean_data5 AS\nSELECT * FROM clean_data4\nWHERE market_avg_days_to_sell BETWEEN 1 AND 500;\n\n-- Create Total Margin column\n-- exact_list_price - wholesale_price doesn't necessarily equal expected_margin; final sales price could be different from exact_list_price\n-- Let's assume that the exact_list_price - wholesale_price is the total max profit we could have made on the deal; let's call this number total_margin\nCREATE TABLE clean_data6 AS\nSELECT quote_id, year, make, model, mileage, location_zip, percent_to_market, market_avg_days_to_sell, n_similar_vehicles_listed, region_short_code, exact_list_price, wholesale_price, seller_source, expected_margin, (exact_list_price - wholesale_price) AS total_margin FROM clean_data5;\n\n-- Create Calculated Margin column\n-- First basic Expected Margin model: use 58% * total margin as an approximate proxy or target\n-- see below for why we use 58%\n-- The margin column is an imputation of missing values using calculated_margin when expected_margin is 0\nCREATE TABLE clean_data7 AS\nSELECT quote_id, year, make, model, mileage, location_zip, percent_to_market, market_avg_days_to_sell, n_similar_vehicles_listed, region_short_code, exact_list_price, wholesale_price, seller_source, expected_margin, total_margin, INT(.58*total_margin) as calculated_margin, IF(expected_margin != 0, expected_margin, INT(.58*total_margin)) AS margin FROM clean_data6;","commandVersion":0,"state":"finished","results":{"type":"table","data":[],"arguments":{},"addedWidgets":{},"removedWidgets":[],"schema":[],"overflow":false,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.47828236748E12,"submitTime":1.478282336195E12,"finishTime":1.478282392625E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"61727350-a232-484c-82f3-c61d45a4bcb7"},{"version":"CommandV1","origId":165,"guid":"b222a37f-82ea-4e0c-8ad6-92bcb0bbcb56","subtype":"command","commandType":"auto","position":0.66925048828125,"command":"%md ### Data Issues\n- Must have an emphasis on data cleaning: avoid garbage in, garbage out problem\n- How accurate is the market price --> percent_to_market? Market price: buy data or scrape websites for used car prices: Kelly Blue Book, Edmunds, NADA, Ebay, Craigslist, etc., compare against similar vehicles (make/model/year/mileage) for sale in area\n- Track actual sales price of similar cars? Ebay, dealers, etc.\n- Assumption: vehicle sold in area it was listed in? Need extra data point: area sold?\n- How about wholesale price? How accurate is the data?\n- More systematic/statistical way of removing outliers\n- Check for valid Year/Make/Model\n- Check for valid range of mileage: >= 0\n- Check for valid location_zip\n- Check for valid range of n_similar_vehicles_listed\n- Check for valid region_short_code\n- Check for valid exact_list_price and wholesale_price\n- Check for valid seller_source\n- Check for valid expected_margin\n- Any duplicates in the data set?\n- Need time of sales data for time series analysis\n- Use caching in Spark as the amount of data gets larger","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.47828233679E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"1bcaf813-8ccd-40a1-9592-6c04872a0b2a"},{"version":"CommandV1","origId":166,"guid":"358ed088-cc3c-4fc1-9683-74873d3d3cb9","subtype":"command","commandType":"auto","position":0.6884765625,"command":"%sql\n\n-- Calculate Profit/Loss statistics\nDROP TABLE IF EXISTS temp_pnl;\nDROP TABLE IF EXISTS pnl;\nDROP TABLE IF EXISTS non_zero_expected_margin;\nDROP TABLE IF EXISTS margin_summary;\n\n-- expected_margin: total loss\n-- expected_margin: total gain\n-- expected_margin: total profit\n-- total profit lost by not converting seller to customer: total(calculated_margin) - total(expected_margin)\n-- conversion rate to shift: # of shift sellers / # of shift inquiries\nCREATE TABLE temp_pnl AS\nSELECT a.total_loss, b.total_gain, c.total_profit, d.total_profit_lost, e.num_shift_sellers, f.num_shift_inquiries FROM \n(SELECT SUM(expected_margin) AS total_loss FROM clean_data7 WHERE expected_margin < 0) as a, \n(SELECT SUM(expected_margin) AS total_gain FROM clean_data7 WHERE expected_margin > 0) as b,\n(SELECT SUM(expected_margin) AS total_profit FROM clean_data7) as c,\n(SELECT (SUM(margin) - SUM(expected_margin)) AS total_profit_lost FROM clean_data7) as d,\n(SELECT COUNT(*) AS num_shift_sellers FROM clean_data7 WHERE expected_margin != 0) as e,\n(SELECT COUNT(*) AS num_shift_inquiries FROM clean_data7) as f;\n\nCREATE TABLE pnl AS\nSELECT total_loss, total_gain, total_profit, total_profit_lost, num_shift_sellers, num_shift_inquiries, num_shift_sellers/num_shift_inquiries AS conversion_rate FROM temp_pnl;\n\n-- non-zero expected_margin vs. total_margin relationship\nCREATE TABLE non_zero_expected_margin AS\nSELECT * FROM clean_data7\nWHERE expected_margin != 0;\n\n-- summarize non-zero expected_margin vs. total_margin relationship\nCREATE TABLE margin_summary AS\nSELECT INT(avg(expected_margin)) AS average_EM, INT(avg(total_margin)) AS average_TM, SUM(expected_margin) AS sum_EM, SUM(total_margin) AS sum_TM, avg(expected_margin)/avg(total_margin) AS EMdivTM FROM non_zero_expected_margin;","commandVersion":0,"state":"finished","results":{"type":"table","data":[],"arguments":{},"addedWidgets":{},"removedWidgets":[],"schema":[],"overflow":false,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.478282392634E12,"submitTime":1.478282337209E12,"finishTime":1.478282406846E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"c176cd2c-a373-495f-af83-8606e52e94f0"},{"version":"CommandV1","origId":167,"guid":"0d89fbf6-99d1-4a50-94ef-77f8e8ba8ee1","subtype":"command","commandType":"auto","position":0.708984375,"command":"# convert tables back to dataframes\ncleaned_data_DF = sqlContext.sql(\"SELECT * FROM clean_data7\")\npnl_DF = sqlContext.sql(\"SELECT * FROM pnl\")\nnon_zero_EM_DF = sqlContext.sql(\"SELECT * FROM non_zero_expected_margin\")\nmargin_summary_DF = sqlContext.sql(\"SELECT * FROM margin_summary\")","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.478282406853E12,"submitTime":1.478282337605E12,"finishTime":1.478282407331E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"1a7e1b9c-a0d6-4580-8d10-352ab0665149"},{"version":"CommandV1","origId":168,"guid":"5723967a-4710-4872-bd3f-13c28f952d16","subtype":"command","commandType":"auto","position":0.713470458984375,"command":"# Overall Profit & Loss numbers. Conversion rate is only 20% of inquiries, resulting in $5m total_profit_lost. Need to get that rate up!\ndisplay(pnl_DF)","commandVersion":0,"state":"finished","results":{"type":"table","data":[[-175775.0,1453136.0,1277361.0,4946720.0,731.0,3532.0,0.20696489241223104]],"arguments":{},"addedWidgets":{},"removedWidgets":[],"schema":[{"name":"total_loss","type":"\"long\"","metadata":"{}"},{"name":"total_gain","type":"\"long\"","metadata":"{}"},{"name":"total_profit","type":"\"long\"","metadata":"{}"},{"name":"total_profit_lost","type":"\"long\"","metadata":"{}"},{"name":"num_shift_sellers","type":"\"long\"","metadata":"{}"},{"name":"num_shift_inquiries","type":"\"long\"","metadata":"{}"},{"name":"conversion_rate","type":"\"double\"","metadata":"{}"}],"overflow":false,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.478282407337E12,"submitTime":1.478282338092E12,"finishTime":1.47828240774E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"49f4b4fb-1f7e-4b59-bf29-7937ffb5d276"},{"version":"CommandV1","origId":202,"guid":"9543ae96-0042-4470-a534-bb8ec568e869","subtype":"command","commandType":"auto","position":0.7146270275115967,"command":"%md ### Plan of Action\n\n**NOTE**: In this notebook, let's refer to Expected Margin as what we want to calculate. Let's refer to expected_margin as the sales data that has been given to us - the non-zero margin of cars that have been sold by Shift.\n\nIn addition, normally we would want to model price. However, in Shift's case, we are modeling Expected Margin = final sales price - the wholesale price. Since the wholesale price is a predetermined, fixed quantity - a constant, we will end up modeling final sales price in the form of Expected Margin.\n\n#### Keeping the end Business Goals in mind\nSo what are we exactly trying to do here? The end goal is to increase profits for the company by using all available data.\n\nHow do we do that? There are many ways.\n\nFor example, from the above, we can use statistics to figure out ways to increase the number of inquiries.\nWe can also use predictive pricing models to figure out ways to best increase the average Expected Margin and conversion rate.\n\n#### Exploratory Data Analysis\nThe point of Exploratory Data Analysis (EDA) is to analyze descriptive statistics of the data in order to prioritize which areas of the business to target. We want to maximize usage of available resources.\n\nFor example, through EDA we can increase profits by figuring out which locations Shift should focus on. Through outreach campaigns to sellers at these locations, we can increase the number of Shift inquiries. Through marketing campaigns to buyers at these locations, we can increase the conversion rate.\n\n#### Predictive Models\nThe point of Predictive Modeling is to generate a pricing model that statistically maximizes profit for the company. This statistical model has 3 uses:\n\n1. Be a better, more consistent predictor of price than arbitrarily picking a percent_to_market price. Through this pricing model, we can identify arbitrage opportunities where cars are underpriced with respect to the market. We can also identify cars that are overpriced, and avoid those cars. By focusing outreach on underpriced cars and avoiding overpriced ones, we can increase the average Expected Margin and total profit for the company.\n\n2. Predict the Expected Margin for cars that we don't have expected_margin data for. Help guide us on how to price those cars in order to maximize profit.\n\n3. From this pricing model, we can also determine if there any underlying factors/features that have a large effect on price. If so, we can use this information to help maximize profits for the company. We can target cars with these features during outreach/marketing campaigns that increase the conversion rate and number of inquiries. This information will help us maximize profits.\n\nWith any statistical model, there's a trade off between complexity and effectiveness. Some models may have the best performance, but may be too complex (optimal parameters too hard to find) to be put into production. For our purposes, let's start with the simplest model first, and then try more complex models:\n\n- The simplest model is the Percent to Market Model (PMM). This model is somewhat arbitrary. Let us determine the market rate for the car and multiple it by a percentage < 100% to arrive at a final sales price. This may not be the best way to price cars as: A. It is very labor intensive and time consuming to gather the market rate for each make/model/year/mileage out there. This process may also be very error prone. B. Results from pricing cars this way may be very random. Still, this is a simple technique and may be worth evaluating.\n\n- Quantitative models may give more consistent results. For our first quantitative model, let us try multivariate linear regression based on car feature set.\n\n- Finally, we can try more sophisticated quantitative models like Gradient Boosted Tree Regression, Support Vector Regression, Neural Networks, etc.\n\nTo evaluate and compare each model, a common training loss function that we can use is the Root Mean Square Error (RMSE) of the Expected Margin generated from the model and the expected_margin of the car actually sold. The goal is to use the pricing model with the smallest RMSE. The smaller the RMSE, the stronger the predictive power of the model. By minimizing RMSE, we can minimize any negative Expected Margin.\n\nIn general, we should try to use the simplest model possible that gives us the desired results that we want. The simpler the model, the fewer sources of error in our calculations, and the easier it is to understand & debug our machine learning system. And we should upgrade our quantitative model only when it consistently gives us better performance.\n\n#### Empirical Testing Framework:\nOnce we have these pricing models, we need a framework to test them in real life.\n\nGiven a pricing model, let us look at metrics of how well the pricing model works in the field. The most important metrics are expected_margin, the number of inquiries, and the number of cars sold through Shift. We can use these metrics to calculate total profit, total profit lost, and the conversion rate. Another useful metric would be the number of days it takes to sell a car.\n\nFor the price testing framework, we can test different pricing models out by region or zip code. In each zip code we can try out a different pricing model to see which one performs the best empirically according to the metrics above. We can also use Cohort Analysis and break the analyses into further subsets, e.g. by Make/Model/Year/Mileage, etc. E.g. for each zip code, which make/model has the highest Expected Margin? The highest conversion rate?\n\nWe can also track the performance over time. If we look at the entire system as closed system with feedback loop, we can adjust model parameters over time to achieve optimal performance/maximum profit. Please note that this production framework must support quick iteration of models.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282338669E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"7c57db2f-96b1-4644-881e-dfb113dfd1e6"},{"version":"CommandV1","origId":169,"guid":"24e6cf24-6407-4c0d-959c-64d167b7bccb","subtype":"command","commandType":"auto","position":0.7157835960388184,"command":"%md ### Exploratory Data Analysis\n\n- I looked at the data in Excel first to come up with plan of action for the data cleaning and exploration.<br>\n- Data exploration is necessary to get an idea of which models to apply.<br> \nYou get a sense for which features are important. (feature engineering)<br> \nIt is also catches outliers in the data.<br>\n- In the data exploration below, I compare expected_margin with calculated_margin from the Percent to Market Model.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282339432E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"e5d53072-9c0a-46d3-9ef2-18fcb17fb4d2"},{"version":"CommandV1","origId":170,"guid":"d1fb5646-2a19-48a6-8b28-63e25a1536b0","subtype":"command","commandType":"auto","position":0.7162742614746094,"command":"# For the most basic model of calculating Expected Margin for the rows where expected_margin is 0, let's compare expected_margin against total_margin for the rows where we do have data for expected_margin. We find that on average, expected_margin is 58% of total_margin.\n# We use this percentage (58%) to calculate the calculated_margin column = 58% * total_margin. This is the Percent to Market Model.\ndisplay(margin_summary_DF)","commandVersion":0,"state":"finished","results":{"type":"table","data":[[1747.0,3008.0,1277361.0,2198974.0,0.5808895421228264]],"arguments":{},"addedWidgets":{},"removedWidgets":[],"schema":[{"name":"average_EM","type":"\"integer\"","metadata":"{}"},{"name":"average_TM","type":"\"integer\"","metadata":"{}"},{"name":"sum_EM","type":"\"long\"","metadata":"{}"},{"name":"sum_TM","type":"\"long\"","metadata":"{}"},{"name":"EMdivTM","type":"\"double\"","metadata":"{}"}],"overflow":false,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.478282407748E12,"submitTime":1.478282339845E12,"finishTime":1.478282408111E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"3d4e91cb-9b9d-47c0-87ae-df45bf8af765"},{"version":"CommandV1","origId":604,"guid":"9f353172-a835-4537-b511-67ce4aeab0f8"," :null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"04a475c3-a99a-44a2-ad73-0df6eaba53f3"},{"version":"CommandV1","origId":197,"guid":"b678bae7-9a05-4f1a-823c-adc77c413885","subtype":"command","commandType":"auto","position":0.9988372474908829,"command":"%md ### Currently Available Research (CAR)\n- **Predicting the Price of Used Cars using Machine Learning Techniques** by Pudaruth\n- **Predicting the Price of Second-hand Cars using Artificial Neural Networks** by Peerun, Chummun, and Pudaruth\n- **Support Vector Regression Analysis for Price Prediction in a Car Leasing Application** by Listiani\n- http://www.datasciencecentral.com/profiles/blogs/predicting-car-prices-part-1-linear-regression\n- https://www.kaggle.com/juliencs/house-prices-advanced-regression-techniques/a-study-on-regression-applied-to-the-ames-dataset\n- https://www.kaggle.com/apapiu/house-prices-advanced-regression-techniques/regularized-linear-models\n- https://www.kaggle.com/c/house-prices-advanced-regression-techniques/kernels","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282345581E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"c34c7f42-c494-4ed6-b27d-2d6a52a83205"},{"version":"CommandV1","origId":198,"guid":"9c1d46b2-630b-4269-aeec-6a20319e9402","subtype":"command","commandType":"auto","position":0.9988904446363449,"command":"%md ### CAR Models<br>\n\n**Comparable Performance**<br>\n- (Multivariate) Linear Regression Analysis\n- Decision Trees / Random Forest / Gradient Boosted Tree\n- K-nearest neighbors\n- Artificial Neural Networks / Multi-layer perceptron: used before to predict commodity prices\n- Naive Bayes: categorical range output\n- Neuro-fuzzy knowledge based system\n- Optimal Distribution of Auction Vehicles (ODAV)<br>\n\n**Best Performance**<br>\n- Support Vector Machine Regression (with genetic algorithm to find optimal SVM parameters)<br>\n  - Some predicted values far away from actual prices for higher priced cars<br>\n  - This method is also a lot more complex than simple linear regression: requires a hyperparameter grid search/genetic algo/training time to find the optimal SVM parameters.<br>\n  - It may be too complex to put into production? Try Spark ParamGrid function<br>","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282345863E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"0f863d76-a75d-4807-980d-c10c1dc9132a"},{"version":"CommandV1","origId":199,"guid":"3ab45766-cda8-4964-8f00-ad6e81d57067","subtype":"command","commandType":"auto","position":0.9989137183874846,"command":"%md ### CAR Factors\n\n**Primary**<br>\n- Age/Year\n- Make\n- Model\n- Mileage\n- Location\n- Country of Manufacture\n- Horsepower\n- Fuel Economy<br>\n\n**Secondary**<br>\n- Physical state\n- Type of fuel\n- Interior style\n- Braking System\n- Acceleration\n- Volume of cylinders\n- Safety Index\n- Size / weight of car\n- Number of doors\n- Paint color\n- Consumer reviews\n- Awards\n- Cruise control\n- Automatic/manual transmission\n- Previous owner corporation or individual\n- Previous accidents\n- Other: A/C, sound, power steering, wheels, GPS, etc.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282346143E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"dfbb7273-1d7b-4d40-b093-5d73af808079"},{"version":"CommandV1","origId":200,"guid":"b3ca527b-e576-4f63-b2ee-d51ad7a7cc9b","subtype":"command","commandType":"auto","position":0.9990234375,"command":"%md ### Predictive Modeling Outline\n\n- Practically speaking, a Data Scientist's job is: Data Gathering / Ingestion --> ETL --> Exploratory Data Analysis --> Model Selection --> Feature Extraction (A/B Testing) --> Parameter Tuning --> Model Scoring --> Model Update over time based on feedback\n  - _Ultimately you need to automate this process_\n  - datarobot.com, skytree.net, h2o.ai? \n- Predictive Modeling attempted with 1. scikit-learn then 2. Spark ML: pyspark.ml chosen, it runs on dataframes on Spark 2.0\n- Multivariate Linear Regression tried first. Assumes normal distribution of variables. Linear Regression also assumes that the relationship between the dependent variable and binary independent variables are homoscedastic. This means that the residuals are approximately equal for all predicted dependent variable scores.\n- For Linear Regression tried 1. Standard 2. Ridge 3. Lasso 4. ElasticNet\n- Then tried Gradient Boosting Tree Regression.\n- In terms of feature selection, tried: 1. region, make, year, mileage, market_avg_days_to_sell, n_similar_vehicles_listed then 2. region, year, mileage, market_avg_days_to_sell, n_similar_vehicles_listed for Honda Civic (most popular Make & Model)","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.478282346492E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"289dbfed-bf92-4466-8b1c-be1b4dec6400"},{"version":"CommandV1","origId":237,"guid":"e89dee07-0af2-4a73-858b-621b2131afe6","subtype":"command","commandType":"auto","position":0.9990306347608566,"command":"%md ### Feature Selection\n\n#### Categorical (Nominal) Features\n- region_short_code: string\n- location_zip: int, remove, not enough consistent information, not good predictor variable, do Cohort Analysis by zip later\n- seller_source: string, remove, already explored through EDA\n- make: string\n- model: string, not enough data for each model, do Cohort Analysis later\n\n#### Numerical Features\n- year: int\n- mileage: int\n- percent_to_market: double, let's not use this as a feature because this is a not a property of the car itself, it's an arbitrary value created by Shift\n- market_avg_days_to_sell: int\t\n- n_s
